BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "nutrition" (
	"restaurant_id"	INTEGER,
	"category_id"	INTEGER,
	"item_id"	INTEGER UNIQUE,
	"serving_size_oz"	INTEGER,
	"calories"	INTEGER,
	"calories_from_fat"	INTEGER,
	"total_fat_g"	INTEGER,
	"total_fat_per_dv"	INTEGER,
	"saturated_fat_g"	INTEGER,
	"saturated_fat_per_dv"	INTEGER,
	"trans_fat_g"	INTEGER,
	"cholesterol_mg"	INTEGER,
	"cholesterol_per_dv"	INTEGER,
	"sodium_mg"	INTEGER,
	"sodium_per_dv"	INTEGER,
	"carbohydrates_g"	INTEGER,
	"carbohydrates_per_dv"	INTEGER,
	"dietary_fiber_g"	INTEGER,
	"dietary_fiber_per_dv"	INTEGER,
	"sugars_g"	INTEGER,
	"protein_g"	INTEGER,
	"vitamin_a_per_dv"	INTEGER,
	"vitamin_c_per_dv"	INTEGER,
	"calcium_per_dv"	INTEGER,
	"iron_per_dv"	INTEGER,
	FOREIGN KEY("category_id") REFERENCES "categories"("id"),
	FOREIGN KEY("restaurant_id") REFERENCES "restaurants"("id"),
	PRIMARY KEY("item_id")
);
COMMIT;
